INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Fields','1','1355852601LJIH'),('Dbtid','1','1355852782MQER'),('Extended','1','1355852783DYRA'),('Checkval','1','1355852783DYRB'),('Extstid','1','1355852783DYRC'),('The name of the listing element to use.<br>','1','1355852784RQNP'),('The name of the form element to use.<br>','1','1355852784RQNQ'),('The specified field type is not defined','1','1356698577BYSZ'),('A view need to be selected.','1','1356698577BYTA'),('Choose a field type','1','1356698582LCCK'),('View Fields','1','1356698583QHMX'),('Fdid','1','1356698583QHMY'),('View Access','1','1356698583QHMZ'),('Modified Date','1','1356698583QHNA'),('Edit Details','1','1356698583QHNB'),('Update All','1','1356698583QHNC'),('Default Column','1','1356698583QHNE'),('Auto Update all Elements','1','1356698583QHNF'),('Default Settings','1','1356698583QHNH'),('Form Preferences','1','1356698583QHNI'),('Listing Preferences','1','1356698583QHNJ'),('Define the required access to view the field.<br>','1','1356698584EBNZ'),('Optional, the name of the field in the database.<br>','1','1356698584EBOA'),('Enable to publish or unpublish the field from all views.<br>','1','1356698584EBOB'),('Define if the field should be searchable.<br>','1','1356698584EBOC'),('Name of the field which will be displayed to the user.<br>','1','1356698584EBOD'),('A description to explain the field. The description will be showed to the user.<br>','1','1356698584EBOE'),('Define the required access to edit the field.<br>','1','1356698584EBOF'),('Choose the type of field you want to create.<br>','1','1356698584EBOG'),('The default value for new value.<br>','1','1356698584EBOH'),('Define if the field should be required.<br>','1','1356698584EBOI'),('The category of the field.<br>','1','1356698584EBOJ'),('Yes will update all view\'s elements when saving the field ( for instance: name, description, access, etc...)<br>No will enable to have different settings for different view\'s elements.<br>','1','1356698584EBOK'),('Fields Definition','1','1356698584EBOL'),('Field Definition','1','1356698584EBOM'),('Link target','1','1356733768PTQW'),('Models & Fields','1','1356733772QJIA'),('Add / Edit','1','1357058833TGKT'),('Radio list','1','1357058839QZXR'),('Checkbox list','1','1357058839QZXS'),('Multiple Select list','1','1357058839QZXT'),('Checkbox in Multiple Select','1','1357058839QZXU'),('Predefined Values','1','1357058839QZXV'),('PHP code','1','1357058839QZXW'),(' - Last Element -','1','1357058839QZXX'),('Add / Edit one value','1','1357058841KKEQ'),('Picklist Sample','1','1357058841KKER'),('The name displayed in the pick-list.<br>','1','1357058841KKET'),('A numeric value, corresponding to the pick-list name.<br>Leave blank for default.<br>','1','1357058841KKEU'),('Define if this value is the default value when no data is selected.<br>','1','1357058841KKEV'),('All Models','1','1357138790PDJD'),('List of available pick-lists','1','1357138793DWSZ'),('<p><strong>New</strong>: Create a new pick-list. Define a name, description and user access.<br />\r\nThe &quot;<strong>Values</strong>&quot; column defines how many values are in the pick-list. Click on &quot;<strong>Add / Edit</strong>&quot; to add new values, or edit the existing one.<br />\r\nUnpublish a pick-list to temporarily disable it.</p>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>The column core define if a pick-list is one you created ( Core = unlocked ) or one which come with the application&nbsp;&nbsp;( Core = locked )<br />\r\n&nbsp;</div>','1','1357138793DWTA'),('Form Parameters','1','1357230914NZVE'),('Listing Parameters','1','1357230914NZVF'),('Edit View','1','1357697641QROB'),('List of custom Fields','1','1359486554KQXA'),('How to design your custom fields?','1','1359486554KQXB'),('This is the list of all fields you have created for the specified model.<br><u>Name</u>: the name which will appear either as the title of the form element or the column header.<br><u>Column</u>: the name of the column in the database\'s table.<br><u>Type</u>: the type of field you have created.<br><u>Order</u>: please note that the ordering might not be exactly the ordering in the view itself as the field can be added in many different views and in many different area in each of those views.<br><u>Update All</u>: Define if all the views should be updated when the field is modified. For instance if you want to change the name of the field throughout all the views. Usually you keep the Update All as Yes. However you could turn it to No if you wish to customized each view.<br><br>','1','1359486555TEWI'),('Field type','1','1359742651HQYX'),('The column $COLUMNNAME already exist! Please choose a different name.','1','1369750859IGJB'),('Sorry, the system lost a parameter, so we need to reset. Simply try again and it all will be fine','1','1369750869THVV'),('The form element could not be saved because there is no reference to a view.','1','1375977746FUII'),('Container','1','1380064817JISM'),('Define in which container the field should be added.','1','1380228929NBOQ'),('Advance Search','1','1382068744SDQH'),('<p>This is a list of all Models ( representation of database tables ), to which you can add customized fields.<br />\r\n<br />\r\nThe column table indicate in which database&#39;s table the data will be stored.</p>\r\n\r\n<p><strong>Related Model</strong> are model which share the same table<br />\r\n<br />\r\nThe column fields indicated how many customized fields you have already created.<br />\r\n<strong>To add a new field</strong> simply click on the Fields column and follow the next wizard.</p>','1','1382669061IVFW'),('Define if the field can be searchable with the advance search functionality.<br>','1','1383926331ELHS'),('The value you entered is already used in this pick-list, please use another value!','1','1387417576HDLZ'),('row1','1','1394069593IQAQ'),('row2','1','1394069593IQAR'),('column1','1','1394069593IQAS'),('column2','1','1394069593IQAT'),('Assignment','1','1394069857XFX'),('column3','1','1395500493HQVV'),('Color','1','1395886787SVJW'),(' ( Area: $AREANAME )','1','1397855844SRLO'),('Identifier','1','1398436917DTKC'),('Define a button','1','1400708734QLWH'),('Icon size','1','1400708900IRZT'),('Icon color','1','1400708900IRZU'),('Choose an icon','1','1400708900IRZV'),('An optional tooltip<br>','1','1400708900IRZW'),('Choose the icon size.<br>','1','1400708900IRZX'),('Choose the icon color.<br>','1','1400708900IRZY'),('Define the button text<br>','1','1400708900IRZZ'),('Choose the button size.<br>','1','1400708901APLS'),('Bootstrap Icon widget','1','1400708901APLT'),('Bootstrap Button widget','1','1400708901APLU'),('Create PopUp','1','1400788093LHUB'),('Is PopUp','1','1400788093LHUC'),('PopUp Width','1','1400788093LHUD'),('PopUp Height','1','1400788093LHUE'),('The link for the button<br>','1','1400788093LHUF'),('The link target tag for the button<br>','1','1400788093LHUG'),('Icon animation','1','1400812016CMWY'),('Choose an icon animation','1','1400812017YLA'),('Fancy Multiple Select','1','1403978942AEUG'),('Choose Parent','1','1409860322PSNC'),('Parent Value','1','1409860322PSND'),('Choose a parent pick-list to have the pick-list depends on the selected value from another pick-list.','1','1409860322PSNE');
INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Choose the value of the parent pick-list.','1','1409860322PSNF'),('User value','1','1409955038JEIA'),('There can be only one value define as&nbsp;User value.&nbsp;<div>If User value is turn on, the child pick list will show an input box so that the user can enter a specific value rather than choosing a predefined value.</div>','1','1409955038JEIB'),('Allow User Value','1','1417090743CGRN'),('Defines the minimum access for the pick-list.','1','1417090743CGRO'),('If User value is turn on, it will allow to defined a pick-list choice called Other, which allow the user to specify their own value.','1','1417090743CGRP'),('This is the Name of the parent value','1','1417207362AUVU'),('This is the value of the parent piccoloist','1','1417207362AUVV'),('<u><b>Step 1:</b></u> define a name for your field. Optionally you can specify a column name.<br>A description is always advisable as it will inform the user on what the field is used for a and show be completed. The description will appear as the tool-tips on the form.<br>Define the type of fields you want to created. Please refer to the documentation for details information on each fields.<br><br><b><u>Step 2:</u></b> finish to complete the information on the left column regarding the default value for the field, the different access level, searchable and required. Those are usually application throughout all the views identically.<br><br><u><b>Step 3:</b></u> Choose the views ( or \"page\" ) to which you want this field to be applied. You do so by clicking on the Available column or button. Once you have done so, you might see new information appearing like the Area or Details Edit.<br>Use the <b><i>Area</i></b> to define in which area the field should be rendered.<br><i><b>Edit Details</b></i> let you customized how the field is specifically rendered in that view.<br><i><b>Edit View</b></i> let you access the all the view elements to make more involved changes to that view.<br><br><u><b>Step 4:</b></u> (optional) In the lower right you can customize some parameters related to that field for the form element or listing element. See documentation for more details.<br><br><br>','1','1418159507MBBP'),('The field \"$FIELD\" already exists!','1','1418159512LBWK'),('Specify a identifier.  Preferably starting with the extension prefix.','1','1418398709LVIH'),('Choose the color of the value','1','1418398709LVII'),('Foreign key inserted','1','1418694571IHYE'),('Unique Key inserted','1','1418694571IHYF'),('$total Views updated with the new column name','1','1418694571IHYG'),('Define the look and feel of the pick-list.','1','1421361227IJHC'),('The field already exist!','1','1423647407JIHV');
